ALTER SESSION SET NLS_DATE_FORMAT='MM/DD/YYYY';
SET LINESIZE 120
SET PAGESIZE 100

DROP TABLE RegistrationService;

CREATE TABLE RegistrationService(
    registration_id     VARCHAR(7)  NOT NULL,    
    task_id             VARCHAR(6) NOT NULL,    
    primary key(registration_id, task_id),
    CONSTRAINT fk_registrationservice_registration FOREIGN KEY(registration_id) REFERENCES Registration(registration_id),
    CONSTRAINT fk_registrationservice_task FOREIGN KEY(task_id) REFERENCES Task(task_id)
);




